query:
/*+ NoMergeJoin(ci t) NoMergeJoin(ci t mc) */ select count(*)
from cast_info AS ci
inner join title AS t
on t.id = ci.movie_id AND ci.person_id = 2985399 AND ci.role_id > 1 AND t.kind_id < 7 AND t.production_year > 1989
inner join movie_companies AS mc
on t.id = mc.movie_id AND mc.company_id < 102178 AND mc.company_type_id = 2;
